import React, { useContext, useEffect } from "react";
import "../Popup/popup.css";
import { scheme } from "../../Components/Portfolio";

const Popup = () => {
  const schemecode = useContext(scheme);

  useEffect(async () => {
    const schemedetails = await fetch(`https://api.mfapi.in/mf/${schemecode}`);
    const schemedetailsjson = schemedetails.json();
    console.log(schemedetails[1]);
    console.log(schemedetailsjson);
    console.log();
  });

  return (
    <div className="popup">
      <div className="inner_popup">
        <p>{schemecode}</p>
        <p>Schemne category</p>
        <p>Schemne type</p>
      </div>
    </div>
  );
};

export default Popup;
